import React from 'react';
import Photo from '../../img/photo.jpg';

function Header() {
	return (
		<header id="header">
			<div className="imgbg">
			</div>
			<div>
				<img id="friedaPic" src={Photo} className="mx-auto d-block" alt="Frieda Silva" />
			</div>
		</header>
	);
}
export default Header;
